import React, { memo } from "react";

function CsvSelect({ options = [] }) {
    return (
        <select>
            <option value="">-- Select --</option>
            {options.map((option, index) => (
                <option key={index} value={option}>
                    {option}
                </option>
            ))}
        </select>
    );
}

export default memo(CsvSelect);
